import React from 'react';

const commentList = ({comments}) => (
    <div class="comment">       
        <h3>Comments:</h3>
        {comments&& comments.length && comments.map((comment, key) =>(
            <div key={key}>
                <h5>{comment.username}</h5>
                <p>{comment.commentText}</p>
            </div>


        ))}
    </div>
)

export default commentList;
